package typify
package labelled

private[typify] trait SelectorPackageAux

trait Selector[A, Key] {
  type Out
  def apply(a: A): Out
}

sealed trait SelectorLP {
  final type Aux[A, K, O] = Selector[A, K] { type Out = O }

  final given tailSelector[H, T <: Tuple, K](using s: Selector[T, K]): Aux[H *: T, K, s.Out] =
    new Selector[H *: T, K] {
      type Out = s.Out
      def apply(t: H *: T): s.Out = s(t.tail)
    }
}

